// === SOUND ===
const SOUNDS = {};
let soundEnabled = true;

function initSounds() {
  const soundData = {
    pollen_pickup: 'data:audio/wav;base64,',
    token_pickup: 'data:audio/wav;base64,',
    enemy_hit: 'data:audio/wav;base64,',
    lightning_zap: 'data:audio/wav;base64,',
    rage_activation: 'data:audio/wav;base64,',
    game_over: 'data:audio/wav;base64,',
  };
  for (const [name, src] of Object.entries(soundData)) {
    SOUNDS[name] = new Audio(src);
  }
}

function playSound(name) {
  if (!soundEnabled || !SOUNDS[name]) return;
  const s = SOUNDS[name].cloneNode();
  s.volume = 0.5;
  s.play().catch(() => {});
}

initSounds();
